Certainly! Let's describe the differences between substantive and procedural law using a pseudocode-like language that is easy to understand and can be translated into any programming language.

### Pseudocode Description

```pseudocode
// Define the types of laws
type LawType = "Substantive" | "Procedural"

// Define a Law class
class Law {
    constructor(type: LawType, name: String, description: String) {
        this.type = type
        this.name = name
        this.description = description
    }

    getType() {
        return this.type
    }

    getName() {
        return this.name
    }

    getDescription() {
        return this.description
    }
}

// Define a function to describe the differences
function describeLawDifferences() {
    // Create instances of Substantive and Procedural laws
    let substantiveLaw = new Law("Substantive", "Murder Law", "Defines the crime of murder and its penalties.")
    let proceduralLaw = new Law("Procedural", "Criminal Procedure", "Describes the steps and rules for criminal trials.")

    // Print the differences
    print("Substantive Law:")
    print("Type: " + substantiveLaw.getType())
    print("Name: " + substantiveLaw.getName())
    print("Description: " + substantiveLaw.getDescription())
    print("")

    print("Procedural Law:")
    print("Type: " + proceduralLaw.getType())
    print("Name: " + proceduralLaw.getName())
    print("Description: " + proceduralLaw.getDescription())
    print("")

    // Explain the differences
    print("Differences between Substantive and Procedural Law:")
    print("1. Substantive Law defines what is a crime or a civil wrong and what the penalties are.")
    print("2. Procedural Law defines the steps and rules for enforcing the substantive law.")
    print("3. Substantive Law is concerned with the rights and duties of individuals.")
    print("4. Procedural Law is concerned with the process of enforcing the rights and duties.")
}

// Call the function to describe the differences
describeLawDifferences()
```

### Explanation

1. **Substantive Law**:
   - **Type**: Defines what is a crime or a civil wrong.
   - **Name**: Example: "Murder Law".
   - **Description**: Defines the crime of murder and its penalties.

2. **Procedural Law**:
   - **Type**: Defines the steps and rules for enforcing the substantive law.
   - **Name**: Example: "Criminal Procedure".
   - **Description**: Describes the steps and rules for criminal trials.

### Differences Explained

1. **Substantive Law**:
   - Defines what is a crime or a civil wrong.
   - Sets out the rights and duties of individuals.
   - Examples include criminal codes, civil codes, and constitutional provisions.

2. **Procedural Law**:
   - Defines the steps and rules for enforcing the substantive law.
   - Concerned with the process of enforcing the rights and duties.
   - Examples include rules of evidence, rules of criminal procedure, and rules of civil procedure.

This pseudocode provides a clear and structured way to understand the differences between substantive and procedural law, which can be easily translated into any programming language.
